import axios from "axios"
import { useState, useEffect } from "react"
import Post from "./post"

export default function Home() {
    const [posts, setPosts] = useState("")
    // const [elements,setElements] = useState("")
    function getPosts() {
        axios({
            method: "GET",
            url: "/api/posts/?format=json"
        }).then((response) => {
            const newposts = response.data
            setPosts(newposts)
            console.log(newposts)
        })
    }
    useEffect(getPosts, [posts])

    // posts.map(setElements(post=><div>
    //     <h1>{post.title}</h1>
    //     <h2>{post.author}</h2>
    //     <p>{post.text}</p>
    // </div>) )

    const elements = posts.map(post => <Post title={post.title} author={post.author} text={post.text}  />)

    return (
        <div>
            {elements}
        </div>
    )
}
